import AnimatedLetters from '../AnimatedLetters';
import './index.scss';

const About = () => {

    const title = "About Me."
    const titleArray = Array.from({length: title.length}, (_, i) => title[i])

    return (
        <div className="container about-page">
            <div className="text-zone">
                <h1>
                <AnimatedLetters
                strArray={titleArray}
                idx={10}
                />
                </h1>
                <p>According to all known laws of aviation, there is no way a bee should be able to fly. Its wings are too small to get its fat little body off the ground. The bee, of course, flies anyway because bees don't care what humans think is impossible.</p>
                <p>Yellow, black. Yellow, black. Yellow, black. Yellow, black. Ooh, black and yellow! Let's shake it up a little. Barry! Breakfast is ready! Ooming! Hang on a second. Hello?</p>
                <p></p>
            </div>
        </div>
    )
}

export default About;
